import { useReducer } from "react";
import styled from "styled-components";
import Nav from "../lib/blocks/nav";
import Reducer from "../lib/reducers";

const Container = styled.div``;

const initalState = {
  show_nav: false
};

function HomePage() {
  const [store, reducer] = useReducer(Reducer.HomePage, initalState);

  return (
    <Container>
      <Nav show={store.show_nav} />
    </Container>
  );
}

export default HomePage;
